import "./post.css";

export default function Post() {
  return (
    <div className="post">
      <img src="https://picsum.photos/200/300" alt="" className="postImg" />
      <div className="postInfo">
        <div className="postCats">
          <span className="postCat">Music</span>
        </div>
      </div>
    </div>
  );
}
